import axios from "axios";
import { useEffect } from "react";

const BASE_URL = "https://fakestoreapi.com";

const getProducts = async () => {
  const [url, setUrl] = useState([]);
  useEffect(() => {
    axios
      .get(`${BASE_URL}/products`)
      .then((response) => {
        setUrl(response.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
};

export { getProducts };
